content: "1\nJehovah no mpiandry ahy\nMpiahy ny fanahy.\nTsy misy atahorako\nFa izy\
  \ no aroko.\n2\n Jehovah no Mpitarika ahy\n Sady mpitondra ahy\n Amoron-dranon'aina\
  \ re,\n Miala sasatra e.\n3\n Jehovah no mpitantana ahy\n Tsy misy mampanahy\n Na\
  \ dia mamaky ny aloky\n Ny fahafatesana\n4\n Jehovah no Mpiaro ahy\n Mamelatra ho\
  \ ahy\n Latabatra eo imason'\n Ny fahavaloko.\n5\nJehovah no Mpanjakako\n Sadybe\
  \ indrafo\n Hitoetra an-kianjanao doria\n No faniriako ety."
id: 10
key: F
title: JEHOVAH NO MPIANDRY AHY
